gIF(){return"The development of application software is our specialty. We develop software for you or strengthen your development team in your projects with our specialists."},
gDM(){return"Applications for the Android OS"},
gPH(){return"Android is a modern operating system for mobile devices and is being developed by the Open Handset Alliance. It is based on the Linux operating system, applications (apps) are created in the Java programming language. Android has opened up a huge market since its appearance in early 2009 and is now found on smartphones, mobile phones, netbooks and tablet PCs. We develop applications for the Android OS or port your existing applications from other platforms to Android."},
gR0(){return"Development of custom software applications"},
gR1(){return"In our projects we mainly use Java as the programming language and use Java programming libraries and standards. So we offer development of\nApplications based on Java Swing and Eclipse RCP\n- Client and server components for web services\n-Web applications based on the Google Web Toolkit (GWT)\n\nPartMaster consistently uses agile methods in application development, so you as a customer can continuously accompany and help shape the development process. You will receive the first software versions at an early stage, which you can check against your requirements and control the further development process. It is guaranteed that you will receive exactly the software on the completion date that best covers your requirements and optimally fulfills your expectations."},
gwE(){return"We develop <em>IT strategies</em>, work out <em>criteria</em> for the use and selection of technologies and products, create <em>software components</em> and integrate them into existing <em>IT architectures</em>. As a small, technology-oriented company, we take on the role of <em>designer, mediator and bridge builder</em> for our customers in order to make use of opportunities for our customers that are offered by new technologies.\n\nOur goal is to complete the processes of the To optimally accompany customers with <em>intuitively operable software</em> and not restrict the <em>creativity</em>, <em>individuality</em> and the possibilities of <em>self-organization</em> of the employees, but to expand them. The work carried out results <em>quickly</em> in <em>concrete results</em>, which guarantees <em>planning security</em> and <em>investment security</em> for the customer."},
gPL(){return"The journey by car is of course possible from different directions. In the immediate vicinity of our offices there is a city car park on Langen Stra\xdfe, where you can conveniently park your car. Coming out of the multi-storey car park, please turn right, walk straight ahead for a few meters and turn left into Lagerstrasse. The entrance to our offices is right here in the courtyard area."},
gPN(){return"From Rostock central station you can take the tram directly to the city center. Here you use the trains in the direction of the city. Get off at the 'Neuer Markt' stop and follow the tram tracks past the Marienkirche. At the next traffic light, cross the tram tracks ('Lange Stra\xdfer'). Then follow the course of Langen Stra\xdfe for a few meters until you see a large archway entrance on the right. Go through this entrance, down the stairs and turn right. Go straight ahead for about 10 meters and then turn left again. You can reach our offices via this inner courtyard."},
